import React from 'react'
import './css/card.css'
import Button from '@mui/material/Button';
export const Card = (props) => {
  return (
    <div className='card'>
    <div className='cardimg' style={{backgroundImage: `url(${props.img})`}}></div>
        <div className='cardtitle'><span className='highlight'>{props.title}</span></div>
        <div className='cardcontent'>{props.data}</div>
        <div className='cardbtn'>
        <Button variant="contained" style={{backgroundColor:'#C770F0',}}><a href="https://github.com/rushikeshchape/Hospital-Management-System"></a>Github</Button>
        </div>
    </div>
  )
}
